.highlight-warning {
  font-weight: normal;
  padding-left: 6px;
  padding-right: 6px;
  color: #1d1f21;
  border-radius: 4px;
  background-color: #de935f;
}
.highlight-error {
  font-weight: normal;
  padding-left: 6px;
  padding-right: 6px;
  color: #1d1f21;
  border-radius: 4px;
  background-color: #cc6666;
}
pre {
  font-size: 13px;
  font-weight: normal;
  color: #a3a5a5;
  border-color: #303337;
  background: #1d1f21;
  border: 0;
}
code {
  padding: 2px 4px;
  font-size: 0.9em;
  color: #ffffff;
  background-color: #303337;
  border-radius: 4px;
}
.tooltip {
  white-space: nowrap;
}
.tooltip.in {
  opacity: 1;
}
.tooltip .tooltip-inner {
  color: #141516;
  box-shadow: 0 12px 36px 0 rgba(0, 0, 0, 0.4) !important;
  line-height: 2rem;
  border-radius: 4px;
  background-color: #a3a5a5;
  white-space: nowrap;
  max-width: none;
}
.tooltip.top .tooltip-arrow {
  border-top-color: #a3a5a5;
}
.tooltip.top-left .tooltip-arrow {
  border-top-color: #a3a5a5;
}
.tooltip.top-right .tooltip-arrow {
  border-top-color: #a3a5a5;
}
.tooltip.right .tooltip-arrow {
  border-right-color: #a3a5a5;
}
.tooltip.left .tooltip-arrow {
  border-left-color: #a3a5a5;
}
.tooltip.bottom .tooltip-arrow {
  border-bottom-color: #a3a5a5;
}
.tooltip.bottom-left .tooltip-arrow {
  border-bottom-color: #a3a5a5;
}
.tooltip.bottom-right .tooltip-arrow {
  border-bottom-color: #a3a5a5;
}
.tree-view-resizer > .tree-view-scroller:not(:first-child) {
  padding-top: 12px;
  border-top: 1px solid #303337;
}
.tree-view {
  font-size: 1rem;
  background: #141516;
}
.tree-view .directory > .header:hover {
  font-weight: normal;
  color: #ffffff;
}
.tree-view .directory::before {
  background: transparent;
}
.tree-view .project-root.project-root {
  padding-bottom: 12px;
}
.tree-view .project-root.project-root::before {
  background: transparent;
}
.tree-view .project-root.project-root:not(:first-child) {
  padding-top: 12px;
}
.tree-view .project-root.project-root:before {
  height: 36px;
  background-clip: padding-box;
}
.tree-view .project-root.project-root > .header::before {
  transition: 400ms opacity ease;
  opacity: 0;
}
.tree-view .project-root.project-root > .header:hover::before {
  opacity: 1;
}
.tree-view .project-root.project-root > .header .name {
  font-weight: normal;
  color: #ffffff;
  font-weight: bold;
  line-height: 36px;
}
.tree-view .project-root.project-root > .header .name:before {
  display: none;
}
